import React from 'react';
import "./Login.css";
import { NavLink } from "react-router-dom";
function  Login() {
  return (

    <div  className=' login '>
     <NavLink to="/">
         <img
          className="login__Image"
          src={require("./image/best-deal.png")}
          alt="no able"
        />
        </NavLink>
    </div>
  )
}

export default Login;
